import React from "react";

import Header from "../header";
import Footer from "../footer";

class PersonalArea extends React.Component {
    render() {
        return (
            <div>
                <Header />
                    <h1>{this.props.authUser.mail}</h1>
                <Footer />
            </div>
        )
    }
}

export default PersonalArea;
